            <h2 className={styles.nortwest}>Northwest Agency</h2>
          </div>
          <div className={styles.postWrapper}>
            <p className={styles.digitalItem}>{postNews.value}</p>
          </div>
          <Like toggle={toggle} el={postNews} id={postNews.id} />
        </div>
        {/* ))} */}
      </>
    )
  },
